import React from 'react'
import { Jumbotron } from 'react-bootstrap'
import Layout from '../../components/Layout/Layout'

function Home() {
    return (
        <Layout>
            <Jumbotron style={{ margin: '5rem', background: 'white' }}>
                <h1>Admin Dashboard</h1>
            </Jumbotron>
        </Layout>
    )
}

export default Home
